import React from 'react';
import { Container, Typography, List, ListItem, ListItemText, Divider } from '@mui/material';

const PreDefinedPath = ({ pathways, match }) => {
  const pathId = match.params.id;
  const pathway = pathways[pathId];

  if (!pathway) {
    return <div>Pathway not found</div>;
  }

  return (
    <Container>
      <Typography variant="h4" sx={{ marginTop: 4, marginBottom: 2 }}>
        {pathway.title} Pathway
      </Typography>
      <List>
        {pathway.steps.map((step, index) => (
          <React.Fragment key={index}>
            <ListItem>
              <ListItemText primary={`${index + 1}. ${step}`} />
            </ListItem>
            {index !== pathway.steps.length - 1 && <Divider />}
          </React.Fragment>
        ))}
      </List>
    </Container>
  );
};

export default PreDefinedPath;
